import React from "react";
import Navbar from "./Navbar";
import "./LandingHomePage.css";

const Header = () => {
  return (
    <div className="header-container">
      <Navbar />
      <div className="header-img">
        <img
          src="https://business.uonbi.ac.ke/sites/default/files/2020-11/job.jpg"
          alt="Header Image"
          title="Header Image"
          className="header-img__image"
        />
      </div>
    </div>
  );
};

export default Header;
